INSERT INTO `house_detailed_info` VALUES ('12', '12', '2023-05-31 00:00:00', '2', '3', '3', '14/1/11/3/4/5/12', '2/1', '3/1/2', '1.[经典户型]：采光好阳光充足宽敞明亮带独立客厅空间十足\n2.[室内装修]：室内是现代装修干净宽敞温馨舒适好房适合居家之选\n3.[交通状况]：附近交通便利靠近14号线地铁站北工大西门站\n4.[周边配套]：周边配套齐全超市菜市场银行医院饭馆等一应俱全\n5.[小区环境]：小区是成熟小区24小时保安安全又放心小区绿化率高为您营造安全舒适的居住环境;', null, '0', '2023-05-09 11:09:25', '2023-05-14 15:53:20');
INSERT INTO `house_detailed_info` VALUES ('13', '14', '2023-06-01 00:00:00', '1', '2', '2', '6/12/13/5/2', '1/6', '1/2', '1、房子情况：小区位置好，紧邻公园，小区绿化好，空气新鲜，易于身心健康，空调、冰箱、洗衣机，家电齐全。\n2、室内情况：干净整洁，温馨舒适，希望未来租户能爱惜房子，保持房屋整洁，就跟住自己家一样。\n3、交通情况：小区门口，地铁8号线永泰庄站，十几条公交路线，四通八达，出行十分方便，方便您的出行。', null, '0', '2023-05-22 18:07:12', '2023-05-22 18:07:12');
